pragma solidity 0.5.16;

contract MyContract {
    uint storedData;
    string public storedString = "aaaa";

    function mySet(uint x) public {
        storedData = x + 2;
    }

    function set(uint x) public {
      storedData = x;
    }

    function setString(string memory s) public {
        storedString = s;
    }

    function myGet() public view returns (uint) {
      return storedData + 1;
    }

    function get() public view returns (uint) {
      return storedData + 1;
    }
}
